$(document).ready(function(){$(".office-search-item.link").click(function(e){var t=$(this);$("#category-search-drop-menu-button").html(t.attr("data-name")+' <span class="caret"></span>'),null!=t.attr("data-id")?$(".new-office-parent-id").val(t.attr("data-id")):$(".new-office-parent-id").val(null),e.preventDefault()}),$(".form-control.category-search.input").keyup(function(){var e=$(".form-control.category-search.input"),t=e.val();console.log("keyup with text: "+t),$(".office-search-item").each(function(e){var a=$(this);a.text().toLowerCase().indexOf(t.toLowerCase())>=0?a.show():a.hide()})}),$(".category-hierarchy.delete").click(function(e){var t=$(this);bootbox.confirm({title:"Remove office?",message:"All of its descendants will also be removed.",buttons:{cancel:{label:'<i class="fa fa-times"></i> Cancel'},confirm:{label:'<i class="fa fa-check"></i> Confirm'}},callback:function(a){1==a&&(window.location.href="/categories/offices/delete?id="+t.attr("data-id"),e.preventDefault())}})})});